@Test 
void testMaxMinWithOneElementArray() throws Exception {
  assertEquals(1, MaxMin2.maxMin2(new int[]{1})[0]);
  assertEquals(1, MaxMin2.maxMin2(new int[]{1})[1]);
}

@Test 
void testMaxMinWithMultipleElementsArray() throws Exception {
  assertEquals(3, MaxMin2.maxMin2(new int[]{1, 2, 3})[0]);
  assertEquals(1, MaxMin2.maxMin2(new int[]{1, 2, 3})[1]);
}

@Test 
void testMaxMinWithNegativeElementsArray() throws Exception {
  assertEquals(-1, MaxMin2.maxMin2(new int[]{-3, -2, -1})[0]);
  assertEquals(-3, MaxMin2.maxMin2(new int[]{-3, -2, -1})[1]);
}
